html {
    height: 100%;
    overflow: hidden;
    font-size: 15px;
}
/* width */
::-webkit-scrollbar {
    width: 0.6rem;
}

/* Track */
::-webkit-scrollbar-track {
    border-radius: 0.7rem;
    background: rgba(0, 0, 0, 0.0);
}

/* Handle */
::-webkit-scrollbar-thumb {
    background: #141c2818; 
    border-radius: 0.7rem;
}

/* Handle on hover */
::-webkit-scrollbar-thumb:hover {
    background: #141c2838; 
}
body {
    margin:0;
    padding:0;
    box-sizing: border-box;
    color: #fff;
    perspective: 1px;
    transform-style: preserve-3d;
    height: 100%;
    overflow-y: scroll;
    overflow-x: hidden;
    font-family: 'Montserrat', sans-serif;
    scroll-behavior: smooth;
    position: relative;
    width: 100vw;
    scrollbar-width: thin;
    scrollbar-color: #141c289c rgba(0, 0, 0, 0.0);
    font-size: 15px;
}
h2 {
    margin: 0;
}
header {
    position: sticky;
    left: 0;
    right: 0;
    top: 0;
    display: flex;
    align-items: center;
    box-sizing: content-box;
    width: 100vw;
    z-index: 5;
    background-color: rgba(0, 0, 0, 0.7);
    border-bottom: 1px solid rgb(44, 44, 44);
    transition: background 200ms linear, height 200ms linear, transform 200ms linear;
    height: 6rem;
    transform: translateZ(0);
    -webkit-transform: translateZ(0);
}   
    .logo {
        font-size: 2rem;
        width: 50%;
        text-align: center;
        font-weight: 100;
        transition: transform 200ms linear;
        display: flex;
        align-items: center;
        justify-content: center;
    }
    .logo-image {
        width: 3rem;
        transform: translateX(3.5rem);
    }
    .logo-color {
        color: #69d8ee;
    }
    .navbar {
        display: flex;
        align-items: center;
        justify-self: flex-end;
        width: 50%;
        /* padding: 1rem; */
        text-align: center;
        justify-content: space-evenly;
        transition: transform 200ms linear;
    }
        .nav-item {
            list-style: none;
        }
            .nav-link,
            .nav-link:active,
            .nav-link:visited {
                text-decoration: none;
                color: #fff;
                padding: 1rem;
                display: flex;
                align-items: center;
            }
            .logo-link {
                justify-content: space-around;
                width: 50%;
            }


.paralax, .paralax::before {
    background: 50% 50% / cover;
}
.paralax {
    height: 100vh;
    padding-bottom: 4.2rem;
    position: relative;
    transform-style: inherit;
    width: 100vw;
    background-color: rgba(0, 0, 0, 0.7);
    z-index: 1;
    box-sizing: border-box;
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
}
.paralax::before {
    content: "";
    bottom: 0;
    left: 0;
    right: 0;
    top: 0;
    position: absolute;
    display: block;
    background-image: url(../img/bg.jpg);
    background-size: cover;
    transform-origin: center center 0;
    transform: translateZ(-1px) scale(3);
    z-index: -1;
    min-height: 100vh;
    box-sizing: border-box;
}
.hero-paralax {
    
    display: flex;
    flex-direction: column;
    align-self: flex-start;
    padding-left: 10vw;
} 
    .paralax-desc {
        font-size: 1.5vw;
        width: 50vw;
        font-weight: 100;
        padding-top: 1.2em;
    }
    .paralax-title {
        font-size: 5vw;
        width: 65vw;
        text-align: start;
        font-weight: 200;
        text-transform: uppercase;   
        line-height: 0.9;
        margin: 0;
        padding: 1em 0;
    }
section {
    position: relative;
    z-index: 1;
    box-sizing: border-box;
    display: flex;
    flex-wrap: wrap;
    width: 100vw;
    min-height: 100vh;
    align-items: center;
    justify-items: center;
    align-content: center;
    justify-content: space-evenly;
}
h2 {
    color: rgb(14, 32, 36);
    font-size: 3rem;
    font-weight: 200;
    text-align: center;
    width: 100vw;
    position: relative;
    margin-top: 6rem;
}
h2::after {
    content: '';
    position: absolute;
    top:150%;
    left: 50%;
    transform: translateX(-50%);
    width: 10vw;
    height: 0.25rem;
    background-color: #69d8ee;
} 
h3 {
    font-size: 2rem;
    font-weight: 200;
    margin: 1rem 0;
}
.about {
    background: #fff;
    color: #141c28cc;
    min-height: 110vh;
}
.about::before
{
    position: absolute;
    top: 0;
    content: "";
    display: block;
    height: 6rem;
    margin-top: -16rem;
    background-color: #fff;
    background-color: #141c28;
}
    .about-item {
        display: flex;
        flex-direction: column;
        align-items: center;
        justify-content: start;
        min-height: 35rem;
        min-width: 27rem;
    }
    .about-icon {
        min-height: 15vw;
        pointer-events: none;
    }
    .about-icon img {
        padding-top: 6rem;
        width: 7rem;
    }
    .about-content {
        padding: 1rem;
        width: 25rem;
        line-height: 2;
        font-size: 1.1rem;
        font-weight: 400;
        text-align: center;
    }
.skills {
    background-color: #141c28;
    color: #fff;
    justify-content: space-around;
}
    .skills-title {
        color: #fff;
    }
    .skills-image img {
        padding-top: 6rem;
        width: 25rem;
        pointer-events: none;
        animation: moveInOut 4000ms ease-in-out infinite;
    }
    .skills-image {
        opacity: 0.7;
        /* transform: skewY(-15deg); */
        transition: opacity 150ms linear;
    }
    .skills-image:hover {
        opacity: 1;
    }
    .skills-content {
        padding-top: 6rem;
        font-size: 1.3rem;
    }
        /* .skills-items {
            padding: 0;
            justify-content: center;
        } */
            .skills-item {
                /* list-style: none; */
                display: flex;
                align-items: center;
                padding: 1rem;
            }
            .skills .fa-2x{
                margin-right: 1rem;
            }
    .skills-familiar {
        margin-top: 1rem;
        padding-bottom: 4rem;
        font-size: 1.3rem;
        width: 100vw;
        display: flex;
        flex-direction: column;
        /* justify-content: center; */
        align-items: center;
    }
        .familiar-items {
            display: flex;
            width: 30rem;
            flex-wrap: wrap;
            align-items: center;
            justify-content: center;
            padding: 0;
        }  
            .familiar-item {
                list-style: none;
                font-size: 1rem;
                padding: 0.4rem;
                border-radius: 0.3rem;
                border: 1px solid #69d8ee;
                margin: 0.5rem;
                font-weight: 200;
            }
.portfolio {
    background-color: #fff;
    color: #141c28;
    /* align-items: start; */
    padding-bottom: 6rem;
}

        .project-image {
            -webkit-box-shadow: 0px 0px 20px 0px rgba(0,0,0,0.15);
            -moz-box-shadow: 0px 0px 20px 0px rgba(0,0,0,0.15);
            box-shadow: 0px 0px 20px 0px rgba(0,0,0,0.15);

            border-radius: 0.5rem;
            border: 1px solid rgba(0, 0, 0, 0.1);
            transition: box-shadow 150ms linear;
            /* margin: 2rem; */
            cursor: pointer;
            text-align: center;
            width: 30rem;
            height: 220px;
            margin-top: 6rem;
        }
        .project-image img {
            width: 30rem;
        }
        .project-image .construction-image {
            width: 14rem;
        }
        .project-image:hover {
            -webkit-box-shadow: 0px 0px 20px 0px rgba(0,0,0,0.2);
            -moz-box-shadow: 0px 0px 20px 0px rgba(0,0,0,0.2);
            box-shadow: 0px 0px 20px 0px rgba(0,0,0,0.2);
        }
        .project-holder {
            /* overflow-y: scroll;
            height: 80vh; */
            font-size: 14px;
            display:flex;
            justify-content: center;
            flex-wrap: wrap;
            /* flex-direction: column; */
            /* display: inline-block; */
            color: #141c28;
            /* margin-top: 6rem; */
            -webkit-box-shadow: 0px 0px 30px 0px rgba(0,0,0,0.13);
            -moz-box-shadow: 0px 0px 30px 0px rgba(0,0,0,0.13);
            box-shadow: 0px 0px 30px 0px rgba(0,0,0,0.13);
            align-items: center;
            width: 100%;
            /* border: 1px solid rgba(0, 0, 0, 0.1); */
        }
        .project-content {
            width: 30rem;
            padding: 1rem;
            font-weight: 400;
            line-height: 1.5;
            display: flex;
            flex-direction: column;
            justify-content: center;
        }
            /* .project-desc {

            } */
            .project-features {
                padding: 0 0 0 1rem;
                margin-top: 0.3rem;
            }
                .project-feature {
                    list-style: none;
                }
            .project-technologies {
                padding: 0;
                display: flex;
            }
                .project-technology {
                    list-style: none;
                    font-size: 1rem;
                    padding: 0.4rem;
                    border-radius: 0.3rem;
                    border: 1px solid #69d8ee;
                    margin: 0.5rem;
                    font-weight: 400;
                    color: #69d8ee;
                    background-color: #141c28;
                    -webkit-box-shadow: 0px 0px 20px 0px rgba(0,0,0,0.2);
                    -moz-box-shadow: 0px 0px 20px 0px rgba(0,0,0,0.2);
                    box-shadow: 0px 0px 20px 0px rgba(0,0,0,0.2);
                }
                .project-buttons {
                    display: flex;
                    justify-content: space-between;
                }
                .project-button {
                    outline-width: 1px;
                    outline-style: inset;
                    outline-color: rgba(0,0,0,0);
                    border: 1px solid #69d8ee;
                    border-radius: 1rem;
                    padding: 0.5rem;
                    margin: 0.5rem;
                    background-color: #fff;
                    color: #69d8ee;
                    width: 40%;
                    /* font-weight: 600; */
                    font-size: 1.1rem;
                    cursor: pointer;
                    transition: background 150ms linear;
                    text-decoration: none;
                    text-align: center;
                }
                .project-button:hover {
                    background-color: #141c28;
                }

.contact {
    background-color: #141c28;
    color: #fff;
    align-self: center;
    justify-self: center;
    padding-bottom: 6rem;
}
    .contact-title {
        color: #fff;
    }
    .contact-info {
        margin-top: 6rem;
    }
        .info-item {
            display: flex;
            align-items: center;
            justify-content: start;
            width: 30rem;
            margin-bottom: 2rem;
        }
            .info-icon {
                margin-right: 5rem;
                padding:1.5rem;
                border: 1px solid #69d8ee;
                border-radius: 50%;
            }
            .info-content {
                display: flex;
                flex-direction: column;
                justify-content:center;
            }   
                .info-heading {
                    margin-bottom: 1rem;
                }
        .contact-social {
            display: flex;
            border-top: 1px solid #69d8ee;
            justify-content: space-between;
        }
            .social-item {
                list-style: none;
                margin-top: 2rem;
            }
                .social-link,
                .social-link:visited,
                .social-link:active {
                    text-decoration: none;
                    color: #fff;
                    padding: 1rem;
                    transition: color 150ms linear;
                    display: block;
                }
                .social-link:hover {
                    color: #69d8ee;
                }

.background {
    background-color: #000;
    height:4rem;
}
.background .logo {
    transform: translateX(-3rem);
}
.unclickable {
    pointer-events: none;
}
.no-scroll {
    overflow: hidden;
}
.perspective {
    perspective: none;
    transform-style: flat;
}
.disabled {
    pointer-events: none;
    opacity: 0.7;
}
.planning {
    padding: 0.1rem;
    border-radius: 0.2rem;
    background-color: #69d8ee;
    color: #141c28;
    border: 1px solid #141c28;
    margin-bottom: 1rem;
    display: inline-block;
}

/* ANIMATIONS */

@keyframes moveInOut {
    /* 0% {transform: translate(-1%, -1%) skewY(15deg);}
    50% {transform: translate(0%, 0%) skewY(15deg);}
    100% {transform: translate(-1%, -1%) skewY(15deg);} */

    0% {transform: translate(-2%, -2%);}
    50% {transform: translate(0%, 0%);}
    100% {transform: translate(-2%, -2%);}

    /* 0% {transform: scale(1) skewY(15deg);}
    50% {transform: scale(1.03) skewY(15deg);}
    100% {transform: scale(1) skewY(15deg);} */

    /* 0% {transform: scale(1);}
    50% {transform: scale(1.03);}
    100% {transform: scale(1);} */
}

/* POPUP */
.popup-overlay {
    position: fixed;
    top:0;
    left:0;
    width: 100%;
    height: 100%;
    z-index: 5;
    transition: opacity 150ms ease-in;
    pointer-events: none;
    opacity: 0;
    background-color: rgba(0, 0, 0, 0.9);
}
    .popup-div {
        border: 1px solid #141c28;
        padding: 1rem;
        position: fixed;
        /* max-width: 90vw; */
        top:50%;
        left:50%;
        transform: translate(-50%, -60%);
        background-color: #fff;
        transition: transform 150ms ease-in;
        border-radius: 1.5rem 0 1.5rem 1.5rem;
        z-index: 21;
    }
        .popup-div-content {
            overflow-y: auto;
            max-width: 80vw;
            z-index: 5;
            max-height: 80vh;
            scrollbar-width: thin;
            scrollbar-color: #141c282a rgba(0, 0, 0, 0.0);
            /* display: flex;
            align-items: center; */
        }
        .popup-div-content img {
            max-width: 70vw;
        }
        .show-popup {
            pointer-events: auto;
            opacity: 1;
        }
        .show-popup .popup-div {
            transform: translate(-50%, -50%);
            /* transform: translateY(50px); */
        }
        .close-popup {
            position: absolute;
            bottom: 101%;
            right: 0;
            cursor: pointer;
            z-index: 10;
            color: #fff;
            transition: color 150ms linear;
        }
        .close-popup:hover {
            color: #69d8ee;
        }
